import "./Slide.css";

 

export default function Slide(props) {
 

	const {name,image,id}=props.categories
	return (
		<>
			<div className="item">
				<div className="category-item">
				 {
					 console.log("categories name:", id )
				 }
						<img
							className="img-fluid custom-slick-img"
							key={image.id}
							src={image.src=='null'? image.src="#":image.src=image.src}
							 alt={image.alt}
							  
					 />
						<h6 style={{fontWeight:'700'}}>
							 {name}
							  
						</h6>
					
				 
				</div>
			</div>
		</>
	);
}
